create table CartNew (
	cart_id VARCHAR(50),
	product_id VARCHAR(50),
	quantity INT,
	created_at DATE,
	modified_at DATE,
	user_id VARCHAR(50),
	order_id VARCHAR(50)
);

select * from CartNew LIMIT 10;

create table PaymentNew (
	payment_id VARCHAR(50),
	date DATE,
	user_id VARCHAR(50),
	detail_id VARCHAR(50)
);

create table ProductNew (
	product_id VARCHAR(50),
	name VARCHAR(50),
	price VARCHAR(50),
	description VARCHAR(50),
	SKU VARCHAR(50),
	category_id VARCHAR(50),
	stock INT
);

create table UserNew (
	user_id VARCHAR(50),
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	phone VARCHAR(50),
	address VARCHAR(50),
	created_at DATE,
	modified_at DATE
);

create table OrderItemNew (
	order_id VARCHAR(50),
	user_id VARCHAR(50),
	product_id VARCHAR(50),
	created_at DATE,
	modified_at DATE
);


create table OrderDetailNew (
	detail_id VARCHAR(50),
	total INT,
	payment_id VARCHAR(50),
	user_id VARCHAR(50),
	order_id VARCHAR(50)
);
